import React from 'react';
import ReactDOM from 'react-dom';
import {Route, BrowserRouter, Switch, Redirect } from 'react-router-dom';

import './index.css';

import App from './App';
import Login from './Login/login';
import Cadastro from './CadastroUsuario/cadastro';
import Medicos from './Medico/medico';
import Pacientes from './Paciente/paciente';
import Consultas from './Consultas/consultas';
import NotFound from './NotFound/notFound';
import ListarConsultas from './Consultas/listarConsultas';

import reportWebVitals from './reportWebVitals';

const routing = (
  <BrowserRouter>
    <div>
      <Switch>
        <Route exact path="/" component={App} />
        <Route exact path="/login" component={Login} />
        <Route exact path="/cadastro" component={Cadastro} />
        <Route exact path="/medicos" componentes={Medicos} />
        <Route exact path="/pacientes" component={Pacientes} />
        <Route exact path="/consultas" component={Consultas} />
        <Route exact path="/notfound" component={NotFound} />
        <Route exact path="/listarconsultas" component={ListarConsultas} />

        <Redirect to="/notfound" />
      </Switch>
    </div>
  </BrowserRouter>
);

ReactDOM.render(
 routing,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
